# -*- coding: utf-8 -*-
from typing import List
import copy

class Solution:
    def solve(self, board: List[List[str]]) -> None:
        """
        Do not return anything, modify board in-place instead.
        """
        if not board or not board[0]:
            return

        directions = [
            (1, 0),
            (-1, 0),
            (0, 1),
            (0, -1)
        ]

        m = len(board)

        n = len(board[0])

        back = copy.deepcopy(board)

        def dfs(table, i, j):

            if isinstance(back[i][j], bool):

                return back[i][j]

            if (i == m - 1 or i == 0) and table[i][j] == 'O':

                back[i][j] = False
                return False

            if (j == n - 1 or j == 0) and table[i][j] == 'O':

                back[i][j] = False
                return False

            # step 暂时第一步做暂时处理
            t = table[i][j]

            res = True

            for d in directions:

                table[i][j] = None

                r, c = i + d[0], j + d[1]

                if 0 <= r < m and 0 <= c < n and table[r][c] == 'O':
                    res = res and dfs(table, r, c)

                table[i][j] = t

            back[i][j] = res
            return res

        for i in range(m):
            for j in range(n):

                if board[i][j] == 'O':
                    r2 = dfs(board, i, j)

                    if r2 is True:
                        board[i][j] = r2

        for i in range(m):
            for j in range(n):

                if board[i][j] is True:
                    board[i][j] = 'X'

        for line in board:
            print(line)


